class TodoListContract {
    constructor(tasks) {
        this.tasks = tasks || [];
    }
    addTask(task) {
        if (!task) {
            throw new Error('Task not found');
        }
        this.tasks.push(task);
        return `Task ${task} was added`;
    }
    getTasks() {
        return this.tasks;
    }
}
